\";s:6:\"mprice\";s:5:\"10000\";s:4:\"mplv\";s:4:\"5-80\";s:10:\"mpseparate\";s:6:\"10-100\";}'),('reward_setting','a:2:{i:0;a:2:{s:3:\"min\";s:5:\"50000\";s:2:\"lv\";s:1:\"8\";}i:1;a:2:{s:3:\"min\";s:6:\"200000\";s:2:\"lv\";s:1:\"8\";}}'),('xy','a:1:{s:4:\"info\";s:17810:\"<p style=\"text-align:center\"><strong><span style=\";font-family:宋体;font-size:24px\"><span style=\"font-family:宋体\">博悦乐购</span></span><span style=\";font-family:宋体;font-size:24px\"><span style=\"font-family:宋体\">商城入驻协议</span></span></strong></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">&nbsp; &nbsp; 本协议由同意并承诺遵守本协议规定使用商城服务的合法经营实体（下称</span>“商户”）、宁波凌宇信息科技有限公司（下称“商城”）共同缔结，具有合同效力。 &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">一、</span></span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">协议内容及生效：</span> &nbsp;&nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">（一）本协议内容包括协议正文及所有商城已经发布的或将来可能发布的各类规则。所有规则为协议不可分割的一部分，与协议正文具有同等法律效力。</span> &nbsp;&nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">（二）商户在使用商城提供的各项服务的同时，承诺接受并遵守各项相关规则的规定。商城有权根据需要不时地制定、修改本协议或各类规则，如本协议有任何变更，商城将在网站上以公示形式通知商户。任何修订和新规则一经公示，商户在七日内如未以书面形式提出相关意见，则新规则即时生效，并成为本协议的一部分。登录或继续使用服务将表示商户接受经修订的协议。除另行明确声明外，任何使服务范围扩大或功能增强的新内容均受本协议约束。</span> &nbsp;&nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">（三）商户签署或在线接受本协议并不导致本协议立即生效，经过商城审核通过并向商户发出服务开通通知时，本协议即在商户和商城之间产生法律效力。</span>&nbsp; &nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">二</span></span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">、商户的声明与保证</span> <span style=\"font-family:宋体\">：</span> &nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">（一）商户必须向商城提供真实、合法、准确、有效的注册资料，并保证其诸如电子邮件地址、联系电话、联系地址、邮政编码等内容的有效性及安全性，保证商城及其他用户可以通过上述联系方式与自己进行联系。同时，商户也有义务在相关资料实际变更时及时更新有关注册资料。</span> &nbsp;&nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">（二）其有合法的主体权利缔结本协议，使用商城相关服务。</span> &nbsp;&nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">（三）其发布于商城的所有信息真实、准确，符合相关法律法规及商城规则。</span>&nbsp;&nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">（四）其对其发布于商城的交易信息中所涉商品有合法的销售权、经营许可权。</span> &nbsp;&nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">（五）其将按照不低于《中华人民共和国产品质量法》、《中华人民共和国消费者权益保护法》及其他法规、部门规章和国家强制性标准规定的要求，出售质量合格商品并提供</span>“三包”等售后服务。 &nbsp;&nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">（六）其在商城出售商品，有义务按照买家实际支付的现金金额为买家开具正规发票，相关税收应按国家相关规定由商户自行承担。</span> &nbsp;&nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">（七）其保证在使用服务进行交易的过程中遵守诚实信用的原则，不在交易过程中采取不正当竞争行为，不扰乱网上交易的正常秩序，不从事与网上交易无关的行为。</span> &nbsp;&nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">（八）其保证在使用服务时实施的所有行为均遵守国家法律、法规和商城的相关规则、规定以及各种社会公共利益及公共道德。如有违反导致任何法律后果的发生，商户应以自己的名义独立承担所有相应的法律责任；</span> &nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">（九）其承诺拥有合法的权利和资格向商城上传有关商品销售信息并进行销售，且前述行为未对任何第三方合法权益，包括但不限于第三方知识产权、物权等构成侵害，如因其行为导致商城遭受任何第三方提起的索赔，诉讼或行政责任，其将承担相应责任并使商城免责。</span> &nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">（十）其承诺不在发布的商品中使用任何未获授权品牌的关键字。</span> &nbsp;&nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">（十一）其承诺接受商城对其出售商品是否具有合法进货来源的不定期检查，其有义务保留其商品具有合法进货来源的相关凭证。对于无法提供合法进货来源凭证的，商城将根据实际情况对商品的真伪作出判断并根据本协议以及商城相关规则进行处理，商户对此承担举证不利的后果。</span> &nbsp;&nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">（十二）其承诺接受商城基于商品品质控制需求对其在售商品进行的质量抽检，检测报告由专业的第三方质检机构出具，其承诺对商城选择的第三方质检机构作出的检测结果不持有异议。对于经检测证明存在质量瑕疵的商品，商户应当及时予以更换，检测费用由商户承担。</span> </span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">（十</span></span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">三</span></span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">）其同意配合商城的宣传推广策略，设置分销商品，自行支付给分销商的推广佣金不低于商品销售额的</span>5%<span style=\"font-family:宋体\">。 &nbsp;&nbsp;</span></span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">（十六）其同意商城的交易模式，售出商品后，在消费者确认收货的同时（消费者未确认收货则于</span>15<span style=\"font-family:宋体\">日内自动确认），由商城把销售额打入商户的会员通个人账户，商户可利用</span></span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">微信</span></span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">将销售额提取现金（</span>50<span style=\"font-family:宋体\">元起提）。 &nbsp;</span></span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">（十七）商户如需解除与商城的合作关系，则须将最后一个订单的货物发完，商城将于</span>15<span style=\"font-family:宋体\">个工作日内将商户交纳的保证金予以无息返还。 &nbsp;&nbsp;</span></span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">四、消费者保障</span> <span style=\"font-family:宋体\">：</span> </span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">消费者保障，只指商户根据本协议约定的条款和条件及商城网站其他公示规则的规定，通过商城发布除二手闲置外的商品（以下简称</span>“全新商品”）信息并向买家出售全新商品时，应履行“商品如实描述”、“商品<span style=\"font-family:Calibri\">7</span><span style=\"font-family:宋体\">天无理由退换货”、“正品保障”义务。商城将在网站不时公示新增的消费者保障义务或对原消费者保障义务内容进行修订。如您对新增或修订的消费者保障义务持有异议，您应当终止本协议，如继续使用商城服务，则意味着接受商城的新增或修订内容。 &nbsp;</span></span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">（一）消费者保障内容</span> &nbsp;&nbsp;<span style=\"font-family:宋体\">在商户通过商城发布商品信息以及与买家进行商品交易过程中，商户承诺遵守以下约定：</span> &nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14px\">1<span style=\"font-family:宋体\">、“如实描述”义务：指对上传于商城的商品信息进行如实描述，并对描述的商品信息（如来源、品质、使用方法、养护措施等）负有举证责任。 &nbsp;</span></span></p><p><span style=\";font-family:宋体;font-size:14px\">2<span style=\"font-family:宋体\">、“</span><span style=\"font-family:Calibri\">7</span><span style=\"font-family:宋体\">天无理由退换货”义务：指当买家购买商户出售的商品，在签收货物后</span><span style=\"font-family:Calibri\">7</span><span style=\"font-family:宋体\">天内，如因买家主观原因不愿完成本次交易，商户承诺同意按照本协议之约定向买家提供退换货服务。如买家与商户就退换货事宜协商未果，买家向商城发起针对商户的维权，并申请“</span><span style=\"font-family:Calibri\">7</span><span style=\"font-family:宋体\">天无理由退换货”赔付时，如商城判定买家赔付申请成立，商户同意按照本协议约定的赔偿金额对买家进行相应的赔付。 &nbsp;</span></span></p><p><span style=\";font-family:宋体;font-size:14px\">3<span style=\"font-family:宋体\">、“遵守承诺”义务：指商户应当严格遵守通过各种方式直接或间接向买家作出的承诺，包括但不限于通过本协议、商城相关规则、商城服务协议以及网络店铺、商品详情页面等方式向买家作出的承诺。 &nbsp;&nbsp;</span></span></p><p><span style=\";font-family:宋体;font-size:14px\">4<span style=\"font-family:宋体\">、“正品保障”义务：指当买家购买商户在商城出售的商品，在收到货物后，如买家认为该商品涉嫌假冒（包括盗版）商品或非原厂正品、未经报关进口商品、假冒材质成份商品（其中假冒商品、未经报关进口商品、假冒材质成份商品的定义以商城规则规定为准）且买家与商户协商未果的前提下，买家在商城指定期间内发起针对商户的维权，申请消费者保障赔付时，如商城判定买家赔付申请成立，商户同意按照本协议之约定向买家退回其实际支付的商品价款，并增加赔偿其受到的损失，并承担维权所涉商品所有物流费用。部分特殊类目商品（如食品）的赔付办法，如国家相关法律法规规定的赔付标准高于本协议的，商户同意以法律法规规定为准。 &nbsp;&nbsp;</span></span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">（二）消费者保障责任及处理</span> &nbsp;&nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14px\">1<span style=\"font-family:宋体\">、商户明确了解并同意商户是消费者保障的责任主体。当发生本协议前述商户应当履行消费者保障义务情形时，商户应保证买家的消费者权益。对于买家因前述问题提出的要求，商户应积极处理。 &nbsp;&nbsp;</span></span></p><p><span style=\";font-family:宋体;font-size:14px\">2<span style=\"font-family:宋体\">、商户同意当商城受理买家提出的消费者保障维权和赔付申请时，商户应积极配合，在商城要求的时间期限内提供相关证据材料，以证明与买家交易的商品不存在买家提出的问题或符合双方的约定，并保证所提交的证据材料真实、合法。如商城以普通非专业人员的知识水平标准，对商户和买家提供的证据材料进行表面审核后，以其独立判断商户未全面履行本协议项下消费者保障内容的，则商城有权根据本协议及其它公示规则的规定，对因此遭受权益损失的买家进行先行赔付。 &nbsp;&nbsp;</span></span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">五、商城的权利和义务：</span> &nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">（一）商城有义务在现有技术上维护整个微商城网上交易平台的正常运行，并努力提升和改进技术，使商户网上交易活动得以顺利进行；</span> &nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">（二）对商户在注册使用服务中所遇到的与交易或注册有关的问题及反映的情况，商城应及时作出回复；</span> &nbsp;&nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">（三）商城有权对商户的注册数据及交易行为进行查阅，发现注册数据或交易行为中存在任何问题或怀疑，均有权向商户发出询问或要求改正的通知，或者直接作出删除或对商户店铺采取限制性措施等处理；</span></span></p><p><span style=\";font-family:宋体;font-size:14px\">&nbsp;(<span style=\"font-family:宋体\">四</span><span style=\"font-family:Calibri\">)</span></span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">如遇到同款同品牌的产品需要上传销售，商城有权选择与具有产品价格优势的一方进行上货，当收到公司产品下架通知后，将下架相关产品。</span></span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">（</span></span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">五</span></span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">）商户在此授予商城免费的许可使用权利</span>(<span style=\"font-family:宋体\">并有权对该权利进行再授权</span><span style=\"font-family:Calibri\">)</span><span style=\"font-family:宋体\">，使商城有权</span><span style=\"font-family:Calibri\">(</span><span style=\"font-family:宋体\">全部或部份</span><span style=\"font-family:Calibri\">)</span><span style=\"font-family:宋体\">使用、复制、修订、改写、发布、翻译、分发、执行和展示商户公示于其商城的各类信息或制作其派生作品，和以现在已知或日后开发的任何形式、媒体或技术，将上述信息纳入其它作品内。 </span></span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">六、协议的终止：</span> &nbsp;&nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">（一）自然终止：本协议到期终止或商户因任何原因终止，则本协议终止。</span> &nbsp;&nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">（二）通知解除：协议任何一方均可以提前十五（</span>15<span style=\"font-family:宋体\">）天书面通知的方式终止本协议。 如商户通过在线点击“确认退出”按钮申请终止本协议，则系统会立即使商户的店铺进入“监管”状态，十五天（</span><span style=\"font-family:Calibri\">15</span><span style=\"font-family:宋体\">）后店铺正式进入退出流程，商户在退出流程后三十天（</span><span style=\"font-family:Calibri\">30</span><span style=\"font-family:宋体\">）天方可处理交易纠纷以及与商城之间的账务、发票等结算事宜。 &nbsp;</span></span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">（三）商城单方解除权：</span><span style=\"font-family:宋体\">如商户违反商城的任何规则或本协议中的任何承诺或保证，包括但不限于本协议项下的任何约定，商城都有权立刻终止本协议，且按有关规则对商户进行处罚。</span> &nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">（</span></span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">四</span></span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">）如非因商城的原因，商户未能按本协议及附件之规定，按期全额支付有关服务费用和活动费用，且在商城规定的时限内仍未支付，商城有权部分或全部中止或终止本协议。</span></span></p><p><span style=\";font-family:Calibri;font-size:14px\">&nbsp;</span></p><p><br/></p>\";}'),('sms','a:3:{s:8:\"sms_user\";s:10:\"inlifeshop\";s:7:\"sms_psw\";s:9:\"aaaaaaaaa\";s:8:\"sms_sign\";s:12:\"博悦乐购\";}');
