DROP TABLE IF EXISTS `dd_mch_order`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `dd_mch_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `mch_id` int(11) NOT NULL,
  `order_id` int(11) NOT NULL,
  `cart_id` text NOT NULL,
  `sn` varchar(50) NOT NULL,
  `user_id` int(11) NOT NULL,
  `name` varchar(20) NOT NULL,
  `mobile` varchar(30) NOT NULL,
  `addr` varchar(200) NOT NULL,
  `addr_id` int(11) NOT NULL,
  `msg` varchar(256) NOT NULL,
  `logis_fee` float(10,2) NOT NULL COMMENT '物流费',
  `total` float(10,2) NOT NULL,
  `points_total` float(10,2) DEFAULT '0.00' COMMENT '所需积分总额',
  `cxpointspay` float(10,2) DEFAULT '0.00' COMMENT '重销积分支付',
  `pointspay` float(10,2) DEFAULT '0.00' COMMENT '自有积分支付',
  `moneypay` float(10,2) DEFAULT '0.00' COMMENT '余额支付要支付的金额',
  `wxpay` float(10,2) DEFAULT '0.00' COMMENT '微信要支付的金额',
  `payway` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1：微信支付；2：余额支付',
  `express` varchar(50) NOT NULL,
  `express_no` varchar(50) NOT NULL,
  `create_time` int(11) NOT NULL,
  `pay_time` int(11) NOT NULL,
  `separate` tinyint(4) DEFAULT NULL,
  `delivery_time` int(11) NOT NULL,
  `confirm_time` int(11) NOT NULL,
  `status` tinyint(11) NOT NULL,
  `is_cancle` tinyint(1) DEFAULT '0' COMMENT '是否申请取消订单',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=231 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

