DROP TABLE IF EXISTS `dd_product`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `dd_product` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(100) NOT NULL,
  `user_id` int(11) DEFAULT '0' COMMENT '所属用户发布id',
  `p_cate_id` int(11) NOT NULL,
  `cate_id` int(11) NOT NULL,
  `cate_tree` text NOT NULL,
  `feature` text,
  `sort` int(11) NOT NULL COMMENT '排序',
  `pic` varchar(256) NOT NULL,
  `banner` text,
  `market_price` float(10,2) NOT NULL,
  `price` float(10,2) NOT NULL,
  `separate` float(10,2) NOT NULL,
  `points` float(11,2) NOT NULL,
  `zq_points` int(11) DEFAULT NULL COMMENT '积分专区所需积分',
  `weight` float(11,2) DEFAULT '0.00' COMMENT '单个物品重量 ',
  `stock` int(11) NOT NULL,
  `param` text COMMENT '产品图文参数',
  `sold` int(11) NOT NULL,
  `score` tinyint(2) DEFAULT '5' COMMENT '综合评分',
  `is_points` tinyint(1) DEFAULT '0' COMMENT '是否积分专区商品',
  `status` tinyint(1) DEFAULT '1' COMMENT '商户上传产品为0，需要审核',
  `reson` text COMMENT '拒绝原因',
  PRIMARY KEY (`id`),
  KEY `id` (`id`) USING BTREE,
  FULLTEXT KEY `feature` (`feature`)
) ENGINE=MyISAM AUTO_INCREMENT=141 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

