 color: rgb(204, 0, 0);\"><span style=\"margin: 0px; padding: 0px; font-size: 24px;\"><span style=\"margin: 0px; padding: 0px; font-weight: 700;\">售后注意事项</span></span></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\"><span style=\"margin: 0px; padding: 0px; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 255);\">新消费法明确规定退货事项</span></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\"><span style=\"margin: 0px; padding: 0px; font-weight: 700;\">?----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">买家在正常的签收后，如发现产品质量问题及时联系我们的，经确认（产品拍照结果）按照相关规定，可办理退换货，由买家将产品原封发回本公司驻地工厂，由客服上报公司财务部审批运费理赔，不带个人到付邮费，故不能将产品发到付，买家可以在本地找最经济的快递公司发货退回，并将快递单号按规定填写到后台，或电话联系售后工作人员，以便提高退换货的速度；我公司签收发回产品后，将会按天猫规定，给买家支付宝账号打回约定的运费。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">1：产品外包装完整，相关配件齐全。 &nbsp;2：商品表面无划痕、无磨损、无磕碰、无使用、无拆卸痕迹。 &nbsp;3：（若有）防伪标识别码未刮开或撕损，（若有）唯一性三包卡不能缺失或撕损。 &nbsp;4：商品原包装完好（原包装指商品的出厂原配包装，不包括物流二次包装）。 &nbsp;5：配件齐全，无丢失，主机无人为损坏。 &nbsp;6：主机无人为划痕与碰撞痕迹。 &nbsp;7：主机的清洁程度不影响二次消售。 &nbsp;8：如有赠品需如数退回。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------</p><p><span style=\"margin: 0px; padding: 0px; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 255);\">A：质量原因退货：</span></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">1：售后客服提供聊天证明 &nbsp; &nbsp; 2：产品外包装完整 &nbsp; &nbsp; 3：产品配件及赠品完整 &nbsp; &nbsp; 4：提供产品及外包装图片 &nbsp; &nbsp; &nbsp;5：产品发票一起寄回</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">&nbsp; &nbsp; &nbsp;我司承担普通运费，按不同地区支付最高支付10-20元运费。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------</p><p><span style=\"margin: 0px; padding: 0px; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 255);\">B：无理由退货</span></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">1：产品不影响二次销售 &nbsp; &nbsp;2：产品外包装完整 &nbsp; &nbsp;3：产品配件及赠品完整 &nbsp; &nbsp;4：返现将折扣 &nbsp; &nbsp;5：产品发票一起寄回</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">&nbsp; &nbsp; &nbsp;包邮产品客户承担返回运费，非包邮产品客户承担来回运费</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------</p><p><span style=\"margin: 0px; padding: 0px; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 255);\">关于发货</span></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">1、音响是含有磁性的产品，只能走陆运相对小件物品物流速度相对会慢一些哦，请亲们耐心等待；</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">2、本店默认邮政快递，广东省内根据地方不同从发货起48-72小时到货，江苏，浙江 、上海，湖北，江西，湖南，安徽，福建、 云 南、从发货起 4天左右到货， 山东、天津、河南、北京, ,上海、广西、湖北、四川、重庆、山西、陕西、从 发货之时起5天左右到货，东北三省，和西北三省，以及内蒙，这些地区相对路程较长，请亲放慢心情，快递小哥会拔山涉水将宝贝送到你手中；所有已购买的产品将在当天下午14点全部发出！</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------</p><p><span style=\"margin: 0px; padding: 0px; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 255);\">关于签收注意事项</span></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------</p><p><span style=\"margin: 0px; padding: 0px; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 255);\">本人签收注意事项</span></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">1：本人签收前当快递员的面开箱验货，查看产品是否有在运送途中出现破损，如外观无任何破损或压坏迹象，</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">&nbsp; &nbsp; &nbsp;可确认并签收物品，如果破损可拒绝签收；</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">2：快递员不让开箱验货时，可投诉快递公司，或在签收后发现问题的请8小时内联系我们，超时不联系的不再以破损理由退换货。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------</p><p><span style=\"margin: 0px; padding: 0px; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 255);\">他人代签收注意事项</span></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">1：他人代签收未能验货的，如之后发现问题，请在签收后12小时联系我们，以便能及时解决问题。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">2：他人代签收后，如发现问题，不在12小时内联系的，本店将视为放弃权力，不再以破损理由退换货。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------</p><p><span style=\"margin: 0px; padding: 0px; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 255);\">技术支持</span></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------</p><p><span style=\"margin: 0px; padding: 0px; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 255);\">问：为什么我的音箱一个响一个不响，或者都不响，怎么回事？</span></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">我们的音箱属2.1声道多媒体电脑有源音箱，副机端使用的是通过3C认证的梅花音频插头，主机箱连接的音频输入端使用的是3.5mm通用音频插头，可适用于大部分音频接口，最常见的立体声插头分三层，每一层都有对应的功能，如果是一个不响，或是半响不响有吵哑声，还是高低音都不响，这种现像有4种可能性：</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">1：接触不良 &nbsp; &nbsp;2：电脑接口问题 &nbsp; &nbsp;3：软件问题 &nbsp; &nbsp;4：电脑设置问题 &nbsp; &nbsp;5：接口不支持 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------</p><p><span style=\"margin: 0px; padding: 0px; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 255);\">解决方法：</span></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">1：查看是否是客观原因的接触不良，把副机和电脑端音频线插到底，插实了</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">2：查看电脑等设备的设置是不是出了问题，是不是设置成了耳麦？正常应该设置成“扬声器”输出功能。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">3：还有可能是软件出了问题，没有安装声卡驱动器，需要自己动手安装</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">4：换台电脑试，或者用手机试，多试几台或换根音频线试一下</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">5：找身边对电子产品了解较多的朋友帮忙</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------</p><p><span style=\"margin: 0px; padding: 0px; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 255);\">问：主音箱发烫是不是有问题？</span></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">主音箱发烫属正常现象，发热在40-60度属正常天气，夏天最高温度散热允许温升70摄氏度，本公司在出货前都经过了一定的老化测试和温控测试，在正常温度请放心使用。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------</p><p><span style=\"margin: 0px; padding: 0px; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 255);\">技术人员建议：</span></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">1：一般正常的室内温度在28度以下，低音箱发热40-50度属音箱正常使用范围。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">2：室内温度超过30度以上的，低音箱发热高出60度以上的，建议用风扇进行降温。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">3：如果没有降温设备可适当间断开机</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">4：有空调的场所则不在此例</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------</p><p><span style=\"margin: 0px; padding: 0px; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 255);\">问：为什么我的音箱音量调到较大时有杂音？</span></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">音箱音量调节可跟据个人喜好调节大小，所有音箱音量都会因为部件功能的限制有一个限度，当超过这个大小时，声音就会产生杂音，专业词语叫做失真，音响系统的失真主要有以下几种：</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\"><span style=\"margin: 0px; padding: 0px; font-weight: 700;\">答：</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">1．谐波失真：所谓谐波失真是指音响系统重放后的声音比原有信号源多出许多额外的谐波成分。此额外的谐波成分信号是信号源频率的倍频或分频，它是由负反馈网络或放大器的非线性特性引起的。高保真音响系统的谐波失真应小于1%。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">2．互调失真：互调失真也是一种非线性失真，它是两个以上的频率分量按一定比例混合，各个频率信号之间互相调制，通过放音设备后产生新增加的非线性信号，该信号包括各个信号之间的和及差的信号。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">3．瞬态失真：瞬态失真又称瞬态响应，它的产生主要是当较大的瞬态信号突然加到放大器时由于放大器的反映较慢，从而使信号产生失真。一般以输入方波信号通过放音设备后，观察放大器输出信号的包络波形是否输入的方波波形相似来表达放大器对瞬态信号的跟随能力。为了更好的保养和延长使用寿命，</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\"><span style=\"margin: 0px; padding: 0px; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 255);\">技术人员建议：</span></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">1：音箱音量不建议开到100，开到较高时，任何音响都会产生杂音，较好的音效调节应在总音量的50-70</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">2：远离手机，手机靠近音箱，会受信号影响使音箱出现失真</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">3：摆放的桌子要结实，不然也因低音箱的共振而产生失真</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\">----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\"><span style=\"margin: 0px; padding: 0px; color: rgb(255, 0, 0);\"><span style=\"margin: 0px; padding: 0px; font-weight: 700; line-height: 1.5;\">注：如是发烧友，玩得不过瘾，觉得声音小，可升级购买W数较高的的音响</span></span></p><p><br/></p><p><br/></p>',0,5,0,1,''),(70,'HYUNDAI/现代 hy-66t笔记本电脑音响台式低音炮迷你USB桌面小音箱，限时优惠',10016,17,58,'17,58','3',29,'./Public/upload/images/1708/26/155549188643004558.jpg','./Public/upload